window.bookSummaryJSON = "From the mind of Brian Jacques - the <i>New York Times</i> best-selling author of the Redwall series - comes another exhilarating adventure in this beloved saga. <p>At the legendary fortress of Salamandastron, aging Lord Asheye has a prophecy: a new, young badger lord must take his place. But Lord Asheye does not know who the young warrior is. Meanwhile, unaware of his destiny, the future lord is captured by infamous fox Vizka Longtooth, who intends to lay siege to Redwall Abbey.</p>"; 
